package Arrays_StringDemo;

public class SwapDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=10,num2=20,temp;
		temp=num1;   //temp=10
		num1=num2;   //num1=20
		num2=temp;   //num2=10
		System.out.println("Num1 is:"+num1);
		System.out.println("Num2 is:"+num2);
	}

}
